def rounded_avg_custom_base(n, m, base):
    import math
    if n > m and base < 2 and (base > 10):
        return -1

    def calc_divisors(num):
        cnt = 0
        for i in range(1, int(math.sqrt(num)) + 1):
            if num % i == 0:
                if num / i == i:
                    cnt = cnt + 1
                else:
                    cnt = cnt + 2
        return cnt

    def calc_arithmetic_sum(a, n, d):
        return n / 2 * (2 * a + (n - 1) * d)
    total = 0
    weights = 0
    for i in range(n, m + 1):
        weight = calc_divisors(i)
        total += i * weight
        weights += weight
    weighted_avg = round(total / weights)
    arithmetic_sum = calc_arithmetic_sum(0, weighted_avg, 1)
    return bin(int(arithmetic_sum)) if base == 2 else oct(int(arithmetic_sum)) if base == 8 else int(arithmetic_sum)

